import React from 'react';

const About = () => {
  return (
    <div>
      <img src="1.jpg" className="mx-auto h-auto" alt="SmartPhone Corner" />
      <div className="centered text-white text-3xl font-bold p-3 mr-40 font-serif caret-emerald-200">
        <br /><br />
        <h2 className="text-3xl font-bold text-center mb-4">About Us</h2>
        <hr />
        <hr />
        <div className="max-w-3xl mx-auto text-lg text-white border-solid border-cyan-50">
          <p className="font-extralight w-full">Welcome to SmartPhone Corner! We are dedicated to bringing you the latest and
            greatest smartphones on
            the market. Whether you're an Android aficionado or an iOS enthusiast, we have something for
            everyone.</p>
        </div>
      </div>
    </div>
  );
};

export default About;
